// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./interfaces/IHederaTokenService.sol";
import {IndexVault} from "./IndexVault.sol";

/**
 * @title IndexTokenController
 * @dev Controller for the index token, handling token creation and minting operations
 */
contract IndexTokenController {
    // Constants
    address public constant HTS_PRECOMPILE = 0x0000000000000000000000000000000000000167;

    // Token addresses
    address public INDEX_TOKEN;

    // Contract references
    address public ADMIN;
    IndexVault public vault;

    // Token configuration
    uint8 public constant TOKEN_DECIMALS = 8;
    uint32 public constant TOKEN_MAX_SUPPLY = 0; // 0 means no maximum supply
    bool public constant IS_SUPPLY_TYPE_INFINITE = true;
    uint32 public constant AUTO_RENEW_PERIOD = 7000000; // ~90 days in seconds

    // State variables
    bool public hasSupplyKey = false;

    // Events
    event IndexTokenMinted(address indexed user, uint256 amount);
    event IndexTokenCreated(address tokenAddress, int64 responseCode);
    event SupplyKeyVerified(bool hasKey);
    event IndexTokenSet(address indexed tokenAddress);
    event TokenCreationAttempt(string name, string symbol, string memo, address treasury);
    event TokenCreationError(int64 responseCode, string errorMessage);
    event TokenCreationStep(string step, address tokenAddress, int64 responseCode);

    // Errors
    error OnlyAdmin();
    error InvalidAmount();
    error TokenCreationFailed(int64 errorCode);
    error NoSupplyKeyForToken();
    error TokenNotAssociated(address token, address account);
    error TokenMintFailed(address token, int64 errorCode);
    error TokenTransferFailed(address token, int64 errorCode);
    error InsufficientDeposits();
    error HtsError(address token, int64 responseCode, string message);
    error PreTokenCreationError(string message);

    // For testing purposes
    IHederaTokenService private hts;

    modifier onlyAdmin() {
        if (msg.sender != ADMIN) {
            revert OnlyAdmin();
        }
        _;
    }

    modifier supplyKeyRequired() {
        if (!hasSupplyKey) {
            revert NoSupplyKeyForToken();
        }
        _;
    }

    /**
     * @dev Constructor to initialize the controller
     * @param _vaultAddress Address of the IndexVault that serves as the token treasury
     * @param _htsAddress Address of the HTS precompile (or mock for testing)
     */
    constructor(
        address _vaultAddress,
        address _htsAddress
    ) {
        hts = IHederaTokenService(_htsAddress == address(0) ? HTS_PRECOMPILE : _htsAddress);
        vault = IndexVault(payable(_vaultAddress));
        ADMIN = msg.sender;
        INDEX_TOKEN = address(0);
    }

    /**
     * @dev Used for testing only - allows setting a mock HTS
     * @param mockHts Address of the mock HTS implementation
     */
    function setTokenService(address mockHts) external onlyAdmin {
        hts = IHederaTokenService(mockHts);
    }

    /**
     * @dev Create the index token with the controller as supply key holder and vault as treasury
     * @param name The name of the token
     * @param symbol The symbol of the token
     * @param memo Additional information about the token
     */
    function createIndexToken(
        string calldata name, 
        string calldata symbol, 
        string calldata memo
    ) external payable onlyAdmin {
        require(INDEX_TOKEN == address(0), "Index token already exists");

        // Log token creation attempt
        emit TokenCreationAttempt(name, symbol, memo, address(this));

        // Create token key arrays - only admin and supply keys
        address[] memory adminKey = new address[](1);
        adminKey[0] = ADMIN;

        address[] memory supplyKey = new address[](1);
        supplyKey[0] = address(this);

        address[] memory emptyKeys = new address[](0);

        // Create token structure
        IHederaTokenService.HederaToken memory token = IHederaTokenService.HederaToken({
            name: name,
            symbol: symbol,
            treasury: address(vault),
            memo: memo,
            supplyType: IS_SUPPLY_TYPE_INFINITE,
            maxSupply: TOKEN_MAX_SUPPLY,
            freezeDefault: false,
            freezeKey: emptyKeys,
            wipeKey: emptyKeys,
            supplyKey: supplyKey,
            adminKey: adminKey,
            kycKey: emptyKeys,
            decimals: TOKEN_DECIMALS,
            autoRenewAccount: address(this),
            autoRenewPeriod: AUTO_RENEW_PERIOD
        });

        // Create key types and addresses arrays
        uint8[] memory keys = new uint8[](3);
        keys[0] = 1; // Admin key
        keys[1] = 4; // Supply key
        keys[2] = 8; // Auto-renew key

        address[] memory keyAddresses = new address[](3);
        keyAddresses[0] = ADMIN;
        keyAddresses[1] = address(this);
        keyAddresses[2] = address(this);

        // Add more detailed error handling
        emit TokenCreationStep("Debug: About to call createToken", address(0), 0);

        // Create token with value for fees
        emit TokenCreationStep("Creating token", address(0), 0);
        int64 responseCode;
        address tokenAddress;
        try hts.createToken{value: msg.value}(token, 0, keys, keyAddresses) returns (int64 code, address addr) {
            responseCode = code;
            tokenAddress = addr;
            emit TokenCreationStep("CreateToken call completed", addr, code);
        } catch (bytes memory errorData) {
            string memory errorMessage = string(errorData);
            if (errorData.length == 0) {
                errorMessage = "Unknown error (empty revert data)";
            }
            emit TokenCreationError(-999, errorMessage);
            revert PreTokenCreationError(errorMessage);
        }

        // Check response
        if (responseCode != 0) {
            string memory errorMessage = responseCode == 22 ? "TOKEN_ALREADY_EXISTS_WITH_DIFFERENT_PROPERTIES" :
                                      responseCode == 27 ? "INVALID_TOKEN_TREASURY_ACCOUNT" :
                                      responseCode == 7 ? "INSUFFICIENT_PAYER_BALANCE" :
                                      "Unknown HTS error";
            emit TokenCreationError(responseCode, errorMessage);
            revert TokenCreationFailed(responseCode);
        }

        // Validate token address
        if (tokenAddress == address(0)) {
            emit TokenCreationError(0, "Token creation succeeded but no token address returned");
            revert TokenCreationFailed(0);
        }

        // Store token address
        INDEX_TOKEN = tokenAddress;
        emit TokenCreationStep("Token address stored", tokenAddress, 0);

        // Associate with token
        emit TokenCreationStep("Associating with token", tokenAddress, 0);
        int64 associateResponse = hts.associateToken(address(this), tokenAddress);
        if (associateResponse != 0) {
            emit TokenCreationError(associateResponse, "Failed to associate with token");
            revert TokenCreationFailed(associateResponse);
        }
        emit TokenCreationStep("Token association complete", tokenAddress, 0);

        // Inform the vault about the token
        emit TokenCreationStep("Updating vault", tokenAddress, 0);
        vault.setIndexToken(tokenAddress);

        // Verify supply key
        emit TokenCreationStep("Verifying supply key", tokenAddress, 0);
        checkSupplyKey();

        emit IndexTokenCreated(tokenAddress, responseCode);
        emit TokenCreationStep("Token creation complete", tokenAddress, 0);
    }

    /**
     * @dev Update the index token ID after deployment
     * @param newIndexTokenAddress The new token address
     */
    function setIndexTokenId(address newIndexTokenAddress) external onlyAdmin {
        require(INDEX_TOKEN == address(0), "Index token already set");
        require(newIndexTokenAddress != address(0), "Cannot set to zero address");

        INDEX_TOKEN = newIndexTokenAddress;

        // Update supply key status
        checkSupplyKey();

        // Inform the vault about the token
        vault.setIndexToken(newIndexTokenAddress);

        emit IndexTokenSet(newIndexTokenAddress);
    }

    /**
     * @dev Verify that this contract has the supply key for the index token
     */
    function checkSupplyKey() public {
        if (INDEX_TOKEN == address(0)) {
            hasSupplyKey = false;
            emit SupplyKeyVerified(false);
            return;
        }

        // Check if this contract has the supply key
        hasSupplyKey = hts.isSupplyKey(INDEX_TOKEN, address(this));
        emit SupplyKeyVerified(hasSupplyKey);
    }

    /**
     * @dev Force update the hasSupplyKey status
     */
    function updateSupplyKeyStatus() external onlyAdmin {
        checkSupplyKey();
    }

    /**
     * @dev Force set the supply key status for testing purposes
     * @param status The new supply key status
     */
    function setSupplyKeyStatus(bool status) external onlyAdmin {
        hasSupplyKey = status;
        emit SupplyKeyVerified(status);
    }

    /**
     * @dev Mint index tokens for a user
     * @param recipient The address to receive the minted tokens
     * @param amount The amount of tokens to mint
     */
    function mintTo(address recipient, uint256 amount) external supplyKeyRequired {
        // Validation: ensure amount is greater than zero
        if (amount == 0) {
            revert InvalidAmount();
        }

        // Verify the recipient has associated the token
        if (!hts.isTokenAssociated(INDEX_TOKEN, recipient)) {
            revert TokenNotAssociated(INDEX_TOKEN, recipient);
        }

        // Validate vault deposits
        bool hasDeposits = vault.validateMint(recipient, amount);
        if (!hasDeposits) {
            revert InsufficientDeposits();
        }

        // Mint tokens to the vault (treasury)
        bytes[] memory metadata = new bytes[](0);
        int64 mintResult = hts.mintToken(INDEX_TOKEN, amount, metadata);
        if (mintResult != 0) {
            string memory message = mintResult == -1 ? "Token not associated" :
                                  mintResult == -2 ? "No supply key" :
                                  mintResult == -3 ? "Invalid amount" :
                                  "Unknown error";
            revert HtsError(INDEX_TOKEN, mintResult, message);
        }

        // Send tokens to the recipient through the vault
        vault.receiveMint(recipient, amount);

        // Emit event for successful mint
        emit IndexTokenMinted(recipient, amount);
    }

    /**
     * @dev Calculate required deposits for minting a specific amount of index tokens
     * @param amount The amount of index tokens to mint
     * @return Tokens and amounts required for the mint
     */
    function calculateRequiredDeposits(uint256 amount) external view returns (address[] memory, uint256[] memory) {
        return vault.calculateRequiredDeposits(amount);
    }

    /**
     * @dev Get token addresses
     * @return The index token address
     */
    function getTokenAddress() public view returns (address) {
        return INDEX_TOKEN;
    }

    // Allow contract to receive HBAR
    receive() external payable {}
}

contracts/index-token/IndexVault.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "./interfaces/IHederaTokenService.sol";

/**
 * @title IndexVault
 * @dev Treasury contract for the index token, handling token custody and composition logic
 */
contract IndexVault {
    // Token addresses
    address public indexToken;

    // Contract references
    address public controller;
    address public admin;
    address public htsAddress;

    // Composition management
    struct Asset {
        address token;
        uint16 weight; // in basis points (e.g., 5000 = 50%)
    }
    Asset[] public composition;

    // User deposits tracking
    mapping(address => mapping(address => uint256)) public deposits; // user => token => amount

    // HTS interaction
    IHederaTokenService private hts;

    // Events
    event DepositReceived(address indexed user, address indexed token, uint256 amount);
    event TokensDistributed(address indexed user, uint256 amount);
    event CompositionUpdated(Asset[] composition);
    event IndexTokenSet(address indexed tokenAddress);

    // Errors
    error OnlyController();
    error OnlyAdmin();
    error TokenNotAssociated(address token, address account);
    error InsufficientDeposit(address token, uint256 required, uint256 actual);
    error TransferFailed(address token, int64 responseCode);
    error InvalidComposition();

    modifier onlyController() {
        if (msg.sender != controller) {
            revert OnlyController();
        }
        _;
    }

    modifier onlyAdmin() {
        if (msg.sender != admin) {
            revert OnlyAdmin();
        }
        _;
    }

    /**
     * @dev Constructor to initialize the vault
     * @param _controller Address of the IndexTokenController that can call this vault
     * @param _htsAddress Address of the Hedera Token Service precompile
     */
    constructor(address _controller, address _htsAddress) {
        controller = _controller;
        admin = msg.sender;
        htsAddress = _htsAddress;
        hts = IHederaTokenService(_htsAddress);
        indexToken = address(0);
    }

    /**
     * @dev Set the index token address - can only be called once
     * @param _indexToken The address of the index token
     */
    function setIndexToken(address _indexToken) external onlyController {
        require(indexToken == address(0), "Index token already set");
        require(_indexToken != address(0), "Cannot set to zero address");

        indexToken = _indexToken;

        // Associate with the token
        int64 associateResponse = hts.associateToken(address(this), _indexToken);
        if (associateResponse != 0) {
            revert TransferFailed(_indexToken, associateResponse);
        }

        emit IndexTokenSet(_indexToken);
    }

    /**
     * @dev Set the composition of the index - which tokens and their weights
     * @param _composition Array of assets and their weights in basis points
     */
    function setComposition(Asset[] calldata _composition) external onlyAdmin {
        // Validate that weights sum to 10000 (100%)
        uint256 totalWeight = 0;
        for (uint i = 0; i < _composition.length; i++) {
            totalWeight += _composition[i].weight;

            // Ensure each token is associated with this contract
            if (!hts.isTokenAssociated(address(this), _composition[i].token)) {
                int64 associateResponse = hts.associateToken(address(this), _composition[i].token);
                if (associateResponse != 0) {
                    revert TransferFailed(_composition[i].token, associateResponse);
                }
            }
        }

        if (totalWeight != 10000) {
            revert InvalidComposition();
        }

        // Clear existing composition
        if (composition.length > 0) {
            delete composition;
        }

        // Set new composition
        for (uint i = 0; i < _composition.length; i++) {
            composition.push(_composition[i]);
        }

        emit CompositionUpdated(_composition);
    }

    /**
     * @dev Validates if a user can mint the specified amount based on their deposits
     * @param user The user address to check
     * @param amount The amount of index tokens to mint
     * @return Whether the user can mint the specified amount
     */
    function validateMint(address user, uint256 amount) external view returns (bool) {
        // Short circuit if composition isn't set
        if (composition.length == 0) {
            return false;
        }

        // Check user has sufficient deposits for each asset in the composition
        for (uint i = 0; i < composition.length; i++) {
            Asset memory asset = composition[i];
            uint256 requiredAmount = (amount * asset.weight) / 10000;

            if (deposits[user][asset.token] < requiredAmount) {
                return false;
            }
        }

        return true;
    }

    /**
     * @dev Receive minted tokens from controller and distribute to user
     * @param user The user to receive the tokens
     * @param amount The amount of tokens to distribute
     */
    function receiveMint(address user, uint256 amount) external onlyController {
        require(indexToken != address(0), "Index token not set");

        // Verify the user has provided sufficient deposits
        for (uint i = 0; i < composition.length; i++) {
            Asset memory asset = composition[i];
            uint256 requiredAmount = (amount * asset.weight) / 10000;

            if (deposits[user][asset.token] < requiredAmount) {
                revert InsufficientDeposit(asset.token, requiredAmount, deposits[user][asset.token]);
            }

            // Deduct the deposit - tokens stay in vault
            deposits[user][asset.token] -= requiredAmount;
        }

        // Transfer the minted index tokens to the user
        if (!hts.isTokenAssociated(user, indexToken)) {
            revert TokenNotAssociated(indexToken, user);
        }

        int64 transferResult = hts.transferToken(indexToken, address(this), user, amount);
        if (transferResult != 0) {
            revert TransferFailed(indexToken, transferResult);
        }

        emit TokensDistributed(user, amount);
    }

    /**
     * @dev Deposit backing assets into the vault
     * @param token The token address to deposit
     * @param amount The amount to deposit
     */
    function depositAsset(address token, uint256 amount) external {
        require(amount > 0, "Amount must be greater than zero");

        // Check if token is part of composition
        bool isValidToken = false;
        for (uint i = 0; i < composition.length; i++) {
            if (composition[i].token == token) {
                isValidToken = true;
                break;
            }
        }
        require(isValidToken, "Token not part of composition");

        // Ensure tokens are associated with this contract
        if (!hts.isTokenAssociated(address(this), token)) {
            revert TokenNotAssociated(token, address(this));
        }

        // Transfer tokens from user to vault
        int64 transferResult = hts.transferToken(token, msg.sender, address(this), amount);
        if (transferResult != 0) {
            revert TransferFailed(token, transferResult);
        }

        // Update user's deposit record
        deposits[msg.sender][token] += amount;

        emit DepositReceived(msg.sender, token, amount);
    }

    /**
     * @dev Calculate required deposit amounts for minting a specific amount of index tokens
     * @param amount The amount of index tokens to mint
     * @return tokens Array of token addresses required
     * @return amounts Array of required amounts for each token
     */
    function calculateRequiredDeposits(uint256 amount) 
        external 
        view 
        returns (address[] memory tokens, uint256[] memory amounts) 
    {
        tokens = new address[](composition.length);
        amounts = new uint256[](composition.length);

        for (uint i = 0; i < composition.length; i++) {
            tokens[i] = composition[i].token;
            amounts[i] = (amount * composition[i].weight) / 10000;
        }

        return (tokens, amounts);
    }

    /**
     * @dev Get user's deposit for a specific token
     * @param user The user address to check
     * @param token The token address to check
     * @return The amount of the token deposited by the user
     */
    function getDeposit(address user, address token) external view returns (uint256) {
        return deposits[user][token];
    }

    /**
     * @dev Update controller address - for future upgrades
     * @param newController The new controller address
     */
    function updateController(address newController) external onlyAdmin {
        require(newController != address(0), "Cannot set to zero address");
        controller = newController;
    }

    /**
     * @dev Update admin address - for future DAO governance
     * @param newAdmin The new admin address
     */
    function updateAdmin(address newAdmin) external onlyAdmin {
        require(newAdmin != address(0), "Cannot set to zero address");
        admin = newAdmin;
    }

    /**
     * @dev Get composition info
     * @return Full composition array
     */
    function getComposition() external view returns (Asset[] memory) {
        return composition;
    }

    /**
     * @dev Accept HBAR transfers
     */
    receive() external payable {}
}

contracts/index-token/interfaces/IHedera.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IHederaTokenService {
    function associateToken(address account, address token) external returns (int64);
    function disassociateToken(address account, address token) external returns (int64);
    function transferToken(address token, address from, address to, uint256 amount) external returns (int64);
    function mintToken(address token, uint256 amount, bytes[] memory metadata) external returns (int64);
    function burnToken(address token, uint256 amount, bytes[] memory metadata) external returns (int64);
    function allowance(address token, address owner, address spender) external view returns (uint256);
    function balanceOf(address token, address account) external view returns (uint256);

    // Token creation function
    function createToken(
        IHederaTokenService.HederaToken memory token,
        uint initialTotalSupply,
        uint8[] memory keys,
        address[] memory keyAddresses
    ) external payable returns (int64 responseCode, address tokenAddress);

    // Key query functions
    function isSupplyKey(address token, address supplyAddress) external view returns (bool);

    // Token association check
    function isTokenAssociated(address account, address token) external view returns (bool);

    // Token info struct
    struct HederaToken {
        string name;
        string symbol;
        address treasury;
        string memo;
        bool supplyType;
        uint32 maxSupply;
        bool freezeDefault;
        address[] freezeKey;
        address[] wipeKey;
        address[] supplyKey;
        address[] adminKey;
        address[] kycKey;
        uint8 decimals;
        address autoRenewAccount;
        uint32 autoRenewPeriod;
    }

    function setAllowance(address token, address owner, address spender, uint256 amount) external;
    function setBalance(address token, address account, uint256 amount) external;
    function setTransferResult(address token, int64 result) external;
    function clearTransferResults() external;
}

